import React from 'react';
import './UserPanel.css';

const UserPanel = ({ user }) => {
  return (
    <div className="user-panel">
      <h2>Hoş geldin, {user.name}!</h2>
      <div className="panel-section">
        <h3>Profil Bilgileri</h3>
        <p>Email: {user.email}</p>
        <p>Kayıt Tarihi: {user.registerDate}</p>
      </div>

      <div className="panel-section">
        <h3>Destek Taleplerim</h3>
        <p>Henüz bir destek talebiniz bulunmamaktadır.</p>
        {/* Buraya ileride destek talepleri listelenebilir */}
      </div>

      <div className="panel-section">
        <h3>Hesap Ayarları</h3>
        <button className="btn">Şifreyi Değiştir</button>
      </div>
    </div>
  );
};

export default UserPanel;
